import React, { useState, useEffect } from "react";
import axios from "axios";
import { ArrowDown, ArrowUp } from "../../common/icons/icons";
import { Link, NavLink, useParams } from "react-router-dom";
import { useSelector } from "react-redux";

const ContractEmployeeMain = () => {
  const [user, setUser] = useState(null);
  const { id } = useParams();

  useEffect(() => {
    getUser();
  }, []);

  const getUser = async () => {
    const response = await axios.get(`http://localhost:5000/users/${id}`);
    setUser(response.data);
  };

  return (
    <div>
      {user ? (
        <div className="div-table">
          <div className="div-table-options">
            <NavLink className="table-options" to="/adduser">
              Dodaj u≈ºytkownika
            </NavLink>
          </div>
          <table className="employee-table">
            <thead>
              <tr className="employee-tr">
                <th>Stanowisko</th>
                <th>Start Kontraktu</th>
                <th>Koniec Kontraktu</th>
                <th>Rodzaj Kontraktu</th>
                <th className="employee-setting">Opcje</th>
              </tr>
            </thead>
            <tbody>
              <tr className="employee-tr">
                <td className="td-employee">
                  {user.profile && user.profile.contracts[0]
                    ? user.profile.contracts[0].position
                    : "Brak danych"}
                </td>
                <td className="td-employee">
                  {user.profile && user.profile.contracts[0]
                    ? user.profile.contracts[0].startContract
                    : "Brak danych"}
                </td>
                <td className="td-employee">
                  {user.profile && user.profile.contracts[0]
                    ? user.profile.contracts[0].endContract
                    : "Brak danych"}
                </td>
                <td className="td-employee">
                  {user.profile && user.profile.contracts[0]
                    ? user.profile.contracts[0].typeContract
                    : "Brak danych"}
                </td>
                <td className="td-employee employee-setting"></td>
              </tr>
            </tbody>
          </table>
        </div>
      ) : (
        <div>Loading...</div>
      )}
    </div>
  );
};

export default ContractEmployeeMain;
